Parse.serverURL = 'https://parseapi.back4app.com/'

export async function saveWaitList(params, callback){


	const waitlisted = new Parse.Object("waitlist");

	waitlisted.set("email", params.email);

	try {
	  	await waitlisted.save()
      	callback('ok')
	  } catch(error) {
		callback('nok')
	  }
}
